def main():
    n = int(input())
    examples = []
    tests = []
    for i in range(n):
        name, type = input().split()
        type = int(type)
        if type == 0:
            tests.append(name)
        else:
            examples.append(name)
    if len(examples) == 0:
        for i in range(len(tests)):
            tests[i] = str(i + 1)
    elif len(examples) == len(tests):
        for i in range(len(tests)):
            tests[i] = str(i + len(examples) + 1)

import sys

def main():
    n = int(sys.stdin.readline().strip())
    files = []
    for i in range(n):
        files.append(sys.stdin.readline().strip().split(' '))

    examples = []
    regular = []
    for file in files:
        if file[1] == '0':
            regular.append(file[0])
        else:
            examples.append(file[0])

    if len(examples) == 0:
        for i in range(len(regular)):
            sys.stdout.write('move ' + regular[i] + ' ' + str(i + 1)

